import React from "react";
import { Modal, Form, Button } from "semantic-ui-react";

export default class AddLeadModal extends React.Component {
	render() {
		const { isAddLeadModalOpen, toggleAddLeadModalOpen } = this.props;
		return (
			<Modal
				onClose={() => toggleAddLeadModalOpen(false)}
				onOpen={() => toggleAddLeadModalOpen(true)}
				open={isAddLeadModalOpen}
			>
				<Modal.Header>Add Lead</Modal.Header>
				<Modal.Content image>
					{/* <Form>
						<Form.Field>
							<label>First Name</label>
							<input placeholder="First Name" />
						</Form.Field>
						<Form.Field>
							<label>Last Name</label>
							<input placeholder="Last Name" />
						</Form.Field>
						<Form.Field>
						</Form.Field>
						<Button type="submit">Submit</Button>
					</Form> */}

          <Form onSubmit={this.handleSubmit}>
          <Form.Group>
            <label>First Name</label>
            <Form.Input
              placeholder='First Name'
              name='firstName'
              value={'name'}
              onChange={this.handleChange}
            />
            <label>First Name</label>
            <Form.Input
              placeholder='Last Name'
              name='lastName'
              value={''}
              onChange={this.handleChange}
            />
            <Form.Button content='Submit' />
          </Form.Group>
        </Form>
				</Modal.Content>
			</Modal>
		);
	}
}
